import React, { Component } from 'react';
import axios from 'axios';

export default class GetRecentDistance extends Component {
  constructor() {
    super();
    this.state = {
      distance: 'Null',
    };
  }

  componentDidMount = () => {
    axios.get('https://e279-124-120-193-98.ap.ngrok.io/beacon-project-9ba72/asia-southeast2/app/runs?userId=U84ccc4d37758502ccde00fb7faa7a16e&limit=1', //eslint-disable-line
      { 
        headers: 
        {
        Authorization: 'Bearer eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJ1c2VySWQiOiJVODRjY2M0ZDM3NzU4NTAyY2NkZTAwZmI3ZmFhN2ExNmUiLCJyb2xlIjoidXNlciIsImlhdCI6MTY1ODcyMjg1Nzg1NiwiZXhwIjoxNjU4NzIyODU4NDU2fQ.wSy0Hr9Ui8NgjaHtEDdRWn79rA4vBo3aiR9ODo3Jr6A' //eslint-disable-line
      }}).then((response) => { //eslint-disable-line
      this.setState({
        distance: response.data,
      });
    });
  };

  render() {
    const dist = (this.state.distance); //eslint-disable-line
    return (
      <div className="mobile-app-widget__top-line mobile-app-widget__top-line--lime">
        <p className="mobile-app-widget__total-stat">{ dist.totalDistance }</p>
      </div>
    );
  }
}
